import React from "react";
import YouTube from "@u-wave/react-youtube";
let videoIdList = ["AOMpxsiUg2Q", "XM-HJT8_esM", "Y-MX24vmECM"];

export class ClassPage extends React.Component {

    constructor(props) {
        super(props);
        this.state = {};
        this.i = 0;
    }

    componentDidMount() {
        this.setState({ videoId: videoIdList[this.i] });
    }

    render() {
        const opts = {
            height: '390',
            width: '640',
            playerVars: { // https://developers.google.com/youtube/player_parameters
                autoplay: 1
            }
        };

        return (
            <YouTube
                video={this.state.videoId}
                opts={opts}
                onReady={this._onReady}
                onEnd={this._onEnd}
            />
        );
    }

    _onEnd = () => {
        this.setState({ videoId: videoIdList[++this.i] });
    }

}
